import React from 'react';
import { Link } from 'react-router-dom';
import './styles1.css'; // Import your CSS file

// Import images
import index from './images/indexbanner.jpg';
import unity3 from './images/unity3.png';
import neon from './images/neonnights.png';
import mobileapp from './images/mobileapp.png';
import vrgame8 from './images/vrgame8.png';
import equipmaster from './images/autoequip.png';
import equipmaster2 from './images/autoequip2.png';

const Header = () => {
  return (
    <div id="header1">
      <section className="header">
        <img src={index} className="back-video" alt="Background Video" />
        <nav>
          {/* Your navigation code */}
        </nav>
        <div className="text-box">
          {/* Your text and description */}
        </div>

        {/* Project Sections using CSS Grid */}
        <div className="projects-grid">
          <div className="project">
            <img src={equipmaster2} alt="Equipmaster" />
            <div className="project-details">
              <h2>Equipmaster</h2>
              <p>
                An addon to automate gear equipping in the game.
                {/* Add your detailed description */}
              </p>
            </div>
          </div>

          <div className="project">
            <img src={vrgame8} alt="BuildaPCVR" />
            <div className="project-details">
              <h2>BuildaPCVR</h2>
              <p>
                VRBuildaPC is a VR PC building simulator.
                {/* Add your detailed description */}
              </p>
            </div>
          </div>

          <div className="project">
            <img src={unity3} alt="Bok Choy" />
            <div className="project-details">
              <h2>Bok Choy</h2>
              <p>
                Adventure game with Amara on a mysterious island.
                {/* Add your detailed description */}
              </p>
            </div>
          </div>

          <div className="project">
            <img src={neon} alt="Neon Nights" />
            <div className="project-details">
              <h2>Neon Nights</h2>
              <p>
                Cyberpunk RPG set in a dystopian future.
                {/* Add your detailed description */}
              </p>
            </div>
          </div>

          <div className="project">
            <img src={mobileapp} alt="EcoConnect Mobile App" />
            <div className="project-details">
              <h2>EcoConnect Mobile App</h2>
              <p>
                App to encourage sustainable living.
                {/* Add your detailed description */}
              </p>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Header;
